description:
Red Maids (Calandrinia menziesii), photographed at Coyote Ridge Open Space Preserve in Santa Clara County, CA.  This photograph shows some key field marks for this common (but still rather pretty) wildflower:  

(1) Cauline leaves alternate, but otherwise highly variable;
(2) Flowere consisting of five petals, five sepals, a single stigma with three styles, and a larger number of anthers.  
(3) Petals bright pink or red in color, slightly notched at the tip but otherwise entire, about 5 mm long and about 5 mm wide at the broadest point;
(4) Sepals generally smaller than petals in both length and breadth.
